import { DeleteIcon } from "@chakra-ui/icons";
import { Box, IconButton, Tooltip } from "@chakra-ui/react";

export const DeleteButton = (props) => {
  return (

		<Tooltip label={props.label}>
<Box>
      <IconButton
        icon={<DeleteIcon />}
				{...props}
        colorScheme={"red"}
        size="sm"
      />
    </Box>
		</Tooltip>

  );
};
